ಲಭ್ಯವಿರುವ ಆದೇಶಗಳು:
  @show              ─ ಕೊನೆಯ ಅಡಾಪ್ಟಿವ್ ಕಾರ್ಡ್ ಸಾರಾಂಶವನ್ನು ತೋರಿಸಿ
  @json              ─ ಫ್ಲೋದಿಂದ ಸ್ವೀಕರಿಸಿದ ಕಚ್ಚಾ JSON ಮೌಲ್ಯವನ್ನು ಹೊರಹಾಕಿ
  @back              ─ ಹಿಂದಿನ ತಡೆದ ಕಾರ್ಡ್/ಇನ್‌ಪುಟ್‌ಗಳಿಗೆ ಹಿಂತಿರುಗಿ
  @input <k>=<v>     ─ ಒಂದು ಇನ್‌ಪುಟ್ ಕ್ಷೇತ್ರವನ್ನು ಹೊಂದಿಸಿ ಅಥವಾ ಮೇಲ್ಬರೆಯಿರಿ
  @click <action_id> ─ ನೀಡಿದ ಕ್ರಿಯೆಯನ್ನು ಬಳಸಿ ಕಾರ್ಡ್ ಅನ್ನು ಸಲ್ಲಿಸಿ
  @help              ─ ಈ ಸಹಾಯ ಪಠ್ಯವನ್ನು ಮುದ್ರಿಸಿ
  @quit              ─ REPL ನಿಂದ ನಿರ್ಗಮಿಸಿ
